<template>
  <div>
    <div class="c-DrawingBoardTest">
      <button id="revoke" @click="handleRevoke">revoke</button>
      <button id="clear" @click="handleClear">clear</button>
      <button id="download" @click="handleDownload">download</button>
      <button id="getDataUrl" @click="handleGetDataUrl">getDataUrl</button>
      <button id="getBlob" @click="handleGetBlob">getBlob</button>
      <button id="getFile" @click="handleGetFile">getFile</button>

      <button id="big" @click="handleBigBtnClick">increase</button>
      <button id="small" @click="handleSmallBtnClick">decrese</button>
      <button id="origin" @click="handleOriginBtnClick">default size</button>

      <button id="hand" @click="handleHandBtnClick">Drag</button>
      <button id="paint" @click="handlePaintBtnClick">paint/write</button>
      <button id="empty" @click="handleEmptyBtnClick">clean</button>

      <button id="reset" @click="handleResetBtnClick">reset</button>

      <hr />
      <input type="color" id="color" value="#ff0000" @change="handleSetPenColor" />

      <input type="range" id="width" value="6" min="1" max="10" @change="handleSetPenWidth" />

      <hr />
      <div id="board"></div>
    </div>
  </div>
</template>

<script>
import messageService from "../api/messages";
import io from "socket.io-client";
import DrawingBoard from "@bryanadamss/drawing-board";
import { mapGetters } from "vuex";

const options = {
  bgImgURL:
    "data:image/jpeg;base64,",
  className: "c-MyCanvas",
  size: [1500, 800],
  bgImgRotate: 90,
  interactiveMode: "both",
  maxRevokeSteps: 20,
  onRevokeStackChange(stack) {
    console.log("onRevokeStackChange回调", stack);
  },
  onPaintEnd(paintCount) {
    console.log("onPaintEnd回调", paintCount);
  }
};

export default {
  name: "drawingboard",
  data() {
    return {
      data: options,
      socket: io("localhost:3000")
    };
  },
  computed: {
    ...mapGetters({
      user: "getUser"
    })
  },
  mounted() {
    window.drawingBoard = new DrawingBoard("#board", this.data);
  },
  created() {},
  methods: {
    handleRevoke() {
      drawingBoard.revoke();
    },

    handleClear() {
      drawingBoard.clear();
    },

    handleDownload(e) {
      console.log(drawingBoard.download());
      drawingBoard.download();
    },

    handleGetDataUrl() {
      console.log(drawingBoard.getDataUrl());
    },

    handleGetBlob() {
      drawingBoard.getBlob().then(blob => {
        console.log(blob);
      });
    },

    handleGetFile() {
      let self = this;
      drawingBoard.getFile().then(file => {
        console.log(file);
        const formData = new FormData();
        formData.append("file", file);
        messageService
          .uploadMessageFiles(formData)
          .then(response => {
            console.log(response.data);
            self.sendImage(response.data);
          })
          .catch(errors => console.log(errors));
      });
    },
    sendImage(file) {
      let messageObj = {
        sender: this.user._id,
        sender_id: this.user._id,
        media: file
      };

      messageService
        .createMessage(messageObj)
        .then(response => {
          this.socket.emit("SEND_MESSAGE", response.data);
        })
        .catch(errors => console.log(errors));
    },
    handleSetPenColor(e) {
      const color = e.target.value;
      console.log(color);

      drawingBoard.setPenStyle({ color });
    },

    handleSetPenWidth(e) {
      const width = parseInt(e.target.value);

      drawingBoard.setPenStyle({ width });
    },

    handleRotate(dir) {
      drawingBoard.rotate(dir);
    },

    handleBigBtnClick() {
      drawingBoard.makeScaleAdd();
      console.log("big", drawingBoard.scale);
    },

    handleSmallBtnClick() {
      drawingBoard.makeScaleSubtract();
      console.log("small", drawingBoard.scale);
    },

    handleOriginBtnClick() {
      drawingBoard.setScale(1);
      console.log("origin", 1);
    },

    handleHandBtnClick() {
      drawingBoard.setPenModeDrag();
      console.log("penMode", drawingBoard.penMode);
    },

    handlePaintBtnClick() {
      drawingBoard.setPenModePaint();
      console.log("penMode", drawingBoard.penMode);
    },

    handleEmptyBtnClick() {
      drawingBoard.setPenModeEmpty();
      console.log("penMode", drawingBoard.penMode);
    },

    handleResetBtnClick() {
      drawingBoard.reset();
    }
  }
};
</script>

<style>
#board {
  outline: 2px dotted blue;
}
</style>
